from tkinter import *
from os import mkdir, path
from threading import Timer
from PIL import Image, ImageTk
import io
import base64
base64_icon = ""
class GmapGen:
    def __init__(self, master):
        self.master = master
        frame = Frame(master, bg="#1e1e1e")
        frame.grid(padx=0, pady=4)
        master.title("Gmap Generator")
        master.configure(bg="#1e1e1e")
        labels = ["Prefix:", "Width:", "Height:", "Center X:", "Center Y:"]
        self.entries = [Entry(frame, width=w, bg="#323232", fg="white") for w in [10, 3, 3, 3, 3]]
        for i, label in enumerate(labels):
         Label(frame, text=label, bg="#1e1e1e", fg="white").grid(sticky=E, row=i, column=0, padx=(0, 0))
         self.entries[i].grid(sticky=W, row=i, column=1, padx=(0, 0))
        self.entries[1].insert(END, 2); self.entries[2].insert(END, 2); self.entries[3].insert(END, 1); self.entries[4].insert(END, 1)
        self.bLinks = IntVar()
        Checkbutton(frame, text="Add level links", var=self.bLinks, bg="#1e1e1e", fg="white", selectcolor="#444").grid(sticky=W, row=5, column=1, padx=(0, 0))
        self.level_format = StringVar(value="numbered")
        for i, text in enumerate(["Numbered (00-01)", "Lettered (aa-aa)"]):
         Radiobutton(frame, text=text, variable=self.level_format, value="numbered" if i == 0 else "lettered", bg="#1e1e1e", fg="white", selectcolor="#1e1e1e").grid(row=6+i, column=0, columnspan=2, sticky='nsew', padx=(0, 0))
        self.lOutput = Label(frame, text='Click "Generate" to create your Gmap!', bg="#1e1e1e", fg="limegreen", width=40, anchor='center')
        self.lOutput.grid(row=8, columnspan=2, pady=4)
        Button(frame, text="Generate", command=self.generate_gmap, bg="#444", fg="white").grid(sticky=N, row=9, column=0, columnspan=2, pady=4)
        Label(frame, text="Concept by Crow, updated by Denveous", bg="#1e1e1e", fg="white", font=("Arial", 8, "italic")).grid(row=10, columnspan=2, pady=4)

    def ClearMsg(self):
        self.lOutput.config(fg="limegreen", text='Click "Generate" to create your Gmap!')

    def Message(self, msg, col):
        self.lOutput.config(fg=col, text=msg)
        Timer(3, self.ClearMsg).start()

    def generate_gmap(self):
        prefix, width, height, center_x, center_y = [entry.get() for entry in self.entries]
        width, height, center_x, center_y = map(self.get_int_value, [width, height, center_x, center_y])
        if not prefix or any(v < 1 for v in [width, height, center_x, center_y]):
            return self.Message("Invalid gmap size!", "red")

        output_dir = prefix
        if not path.exists(output_dir): mkdir(output_dir)
        gmap_content = f"GRMAP001\nWIDTH {width}\nHEIGHT {height}\nLEVELNAMES\n"

        for y in range(height):
            for x in range(width):
                level_name = f"{prefix}_{self.get_coords(x + 1, y + 1, center_x, center_y)}.nw"
                gmap_content += f'"{level_name}",'
                with open(path.join(output_dir, level_name), 'w') as level_file:
                    level_file.write(self.get_level_content(x + 1, y + 1))
            gmap_content += "\n"
        gmap_content += "LEVELNAMESEND\n"
        with open(path.join(output_dir, f"{prefix}.gmap"), 'w') as gmap_file:
            gmap_file.write(gmap_content)
        self.Message("Gmap created successfully!", "limegreen")

    def get_int_value(self, value):
        try: return int(value)
        except ValueError: return -1  

    def get_coords(self, x, y, center_x, center_y):
        if self.level_format.get() == "numbered":
            xs = str(x - center_x).zfill(2) if x >= center_x else str(center_x - x - 1).zfill(2)
            ys = str(y - center_y).zfill(2) if y >= center_y else str(center_y - y - 1).zfill(2)
        else: 
            xs = f"{chr(97 + (x - 1) // 26)}{chr(97 + (x - 1) % 26)}"
            ys = f"{chr(97 + (y - 1) // 26)}{chr(97 + (y - 1) % 26)}"
        return f"{xs}-{ys}"

    def get_level_content(self, x, y):
        level_content = "GLEVNW01\n"
        template_file_path = "template.nw"
        if path.exists(template_file_path):
            with open(template_file_path, 'r') as template_file:
                level_content += template_file.read()
        else:
            fValues = 'f/' * 64
            level_content += ''.join(f"BOARD 0 {i} 64 0 {fValues}\n" for i in range(64))
        
        if self.bLinks.get():
            level_content += self.get_links(x, y)
        return level_content

    def get_links(self, x, y):
        links = ""
        if x > 1: links += f"LINK {self.get_coords(x - 1, y)}.nw 0 0 1 64 61 playery\n"
        if x < self.get_int_value(self.entries[1].get()): links += f"LINK {self.get_coords(x + 1, y)}.nw 63 0 1 64 0 playery\n"
        if y > 1: links += f"LINK {self.get_coords(x, y - 1)}.nw 0 0 64 1 playerx 61\n"
        if y < self.get_int_value(self.entries[2].get()): links += f"LINK {self.get_coords(x, y + 1)}.nw 0 63 64 1 playerx 0\n"
        return links

def load_icon_from_base64(base64_str):
    image_data = base64.b64decode(base64_str)
    image = Image.open(io.BytesIO(image_data))
    return ImageTk.PhotoImage(image)

if __name__ == "__main__":
    root = Tk()
    root.geometry("275x280")
    icon_image = load_icon_from_base64(base64_icon)  
    root.wm_iconphoto(False, icon_image)
    root.resizable(False, False)
    app = GmapGen(root)
    root.mainloop()